import React, { Component } from 'react';

class Products extends Component {
    constructor(props) {
        super(props);
        this.state = {
          product: null,
        };
      }
      render() { 
        return ( 
        <div>
            {this.props.products.map(product =>(
                <a href="#" key={product.id}>
                <img src={product.image} alt={product.title} />
                <h4>{product.title}</h4>
                </a>
            ))}

        </div> );
    }
}
 
export default Products;
